(1, 0, '2021-08-24 12:50:03', '​ \r\n​     \r\n\r\nWEBINAR\r\n=======\r\n          \r\n\r\nFundamentals Of Locators And Xpath In Selenium\r\n----------------------------------------------\r\n \r\n------------------------------------------------------------------------------------------------------------------\r\n \r\nTuesday | 11 MAY 2021 | 10 AM PST       \r\n           \r\n     \r\nYour Hosts: Sanjay Kumar from Selectors Hub and Harshit Paul from LambdaTest  \r\n------------------------------------------------------------------------------------------------------------------\r\n     https://www.lambdatest.com/webinar/fundamentals-of-locators-and-xpath-in-selenium  REGISTER NOW [ https://www.lambdatest.com/webinar/fundamentals-of-locators-and-xpath-in-selenium ]     \r\nHi Asif ,  \r\nNew to automation testing and wants to know the basic fundamentals of Xpath and Locators in Selenium. This webinar is just the right fit for you. You will also get to know how you can speed up your go to market launch by spending less time in web testing and debugging. ​ \r\nIn this webinar, Harshit Paul, Product & Growth Manager from LambdaTest and Sanjay Kumar, Inventor and creator Selectors Hub, hitch up to educate various fundamentals around Xpath and Locators in Selenium. They will also touch base on how selector’s hub solves problems solves various challenges testers face during test automation in relation to XPath locators.  \r\n\r\n### \r\n\r\nWhat will you learn?\r\n​ \r\n * What is Xpath? \r\n* Why is it important for Selenium automation? \r\n* Types of XPath - Absolute & Relative \r\n* XPath axes methods \r\n* What challenges testers face during test automation in relation to XPath Locators? \r\n* How selector’s hub helps in solving tester’s problem relating to Xpath Locators? \r\n* How to execute tests on cloud grid using selector’s hub and LambdaTest? ​                                  ​ \r\n​     https://www.lambdatest.com/webinar/fundamentals-of-locators-and-xpath-in-se