(3, 0, '2021-08-24 12:50:03', '\r\n      https://www.lambdatest.com/            \r\n\r\nLambdaTest Now Live with Microsoft Teams App\r\n============================================\r\n          \r\nHi Asif ,  \r\nWe are excited to announce that LambdaTest is now live with an all new Microsoft Teams Application. This application will allow users to scale up their level of cross browser testing directly from Teams.  \r\nWith the LambdaTest Microsoft Teams App, users can now run realtime and screenshot tests faster directly from the Teams App ensuring increased productivity while working.        \r\n       https://teams.microsoft.com/l/app/4994e003-2297-48cd-a827-fb2be20cc28a?source=store-copy-link  Install Now [ https://teams.microsoft.com/l/app/4994e003-2297-48cd-a827-fb2be20cc28a?source=store-copy-link ]         \r\n\r\nSome cool features of LambdaTest Microsoft Teams App:\r\n-----------------------------------------------------\r\n  \r\nEasily perform Real-Time Testing and Screenshot Testing of your websites and web apps directly from Microsoft Teams App.           \r\nEasily collaborate over UI issues, integrated web debugging, streamline your feedback loops, and much more.           \r\nSave your time with reusable test cards and launch the test with the same configurations.            \r\nGot Questions? Please don\'t hesitate to contact our 24/7 support center at \r\nsupport@lambdatest.com   https://www.facebook.com/lambdatest/    https://twitter.com/Lambdatesting    https://www.linkedin.com/company/lambdatest/    https://www.youtube.com/channel/UCCymWVaTozpEng_ep0mdUyw?sub_confirmation=1  \r\nNot Interested?  https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f20ed60c1&sd=13f52e3f20ec60a9&n=11699e4c0eaa221  Unsubscribe [ https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f20ed60c1&sd=13f52e3f20ec60a9&n=11699e4c0eaa221 ]      \r\n\r\n', 3, 'a:0:{}', 0, 0),
(4, 0, '2021-08-24 12:50:03', 'To view this email as a web page, go to the following address: https://lp.activtrak.com/index.php/email/emailWebview?mkt_tok=ODM5LVRRTS04ODMAAAF9Am1tX1N9ugIqFHNwFWYYGn7aGL34-l4OFRFnXLNF6jFGwX-br-VpDAF4x2kFkQaVi-Y7oIZEcjIVZ2EkauoRws0o2-DgO5LvPRw19PR_&md_id=6271\r\n\r\nLog In→ <https xss=removed>\r\nManagers play a vitally important role in every organization; translating the strategy and goals of the business into the operational plans and focus areas for their teams. As more and more work has shifted into the digital space, managers need new tools to understand how their teams are working, ensure everyone is focused on the right priorities, and help support healthy work habits.\r\n\r\nJoin this webcast Thursday, May 20th at 10 a.m CT to get a practical playbook for using the insights in ActivTrak to make your goals easier to achieve, and help everyone work more wisely.\r\n\r\nSpecifically, you’ll learn:\r\n\r\n\r\n\r\n - Definitions of key productivity metrics for the digital workforce\r\n - Examples of insights that can be a starting point for collaborative problem-solving\r\n - How to use benchmarks and goals to assess team performance\r\n - Best practices for sharing individual and team insights on an ongoing basis\r\n - And more!\r\nThursday,\r\n\r\nMay 20th\r\n10:00 AM CST\r\nREGISTER NOW <https xss=removed>\r\nCan\'t make this time? Register anyway and we\'ll send you the recording.\r\nActivTrak \r\n 3101 Bee Caves Rd., Suite 200 Austin, TX 78746\r\n\r\n This email was sent to php.asif@wingshieldtechnologies.com <https xss=removed>, if you no longer want to receive emails, unsubscribe here &lt;[[https://lp.activtrak.com/UnsubscribePage.html?mkt_unsubscribe=1&mkt_tok=ODM5LVRRTS04ODMAAAF9Am1tX1N9ugIqFHNwFWYYGn7aGL34-l4OFRFnXLNF6jFGwX-br-VpDAF4x2kFkQaVi-Y7oIZEcjIVZ2EkauoRws0o2-DgO5LvPRw19PR_]]>. \r\n\r\n Copyright © 2021 ActivTrak. All rights reserved.\r\n', 4, 'a:0:{}', 0, 0);
