(11, 0, '2021-08-24 12:50:06', 'Hear experts from popular test automation frameworks like Selenium, Puppeteer, WebdriverIO & more.\r\n\r\nWEBINAR SERIES\r\nhttps://www.browserstack.com/events/summer-of-learning?utm_source=unattributed&utm_medium=email&utm_campaign=bsol-2021&utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941\r\n\r\nHi,\r\n\r\nWe’re excited to announce BrowserStack Summer of Learning 2021 (https://www.browserstack.com/events/summer-of-learning?utm_source=unattributed&utm_medium=email&utm_campaign=bsol-2021&utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941) —a 5-part webinar series featuring sessions about leading test automation frameworks such as Selenium, Puppeteer, Nightwatch, Cypress, and WebdriverIO.\r\n\r\nChoosing the right test automation framework has always been a difficult decision to make. Join us and let the framework experts guide you through this decision. You’ll learn about:\r\n* How these frameworks work\r\n* What their capabilities are\r\n* How to get started\r\n\r\nLast year, we saw over 4,000 registrations and 2,000+ attendees from around the world. Don’t miss this opportunity to learn all about test automation frameworks from the best, on June 30th and July 7th.\r\nRegister for free (https://www.browserstack.com/events/summer-of-learning?utm_source=unattributed&utm_medium=email&utm_campaign=bsol-2021&utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941)\r\n\r\nCheers,\r\nTeam BrowserStack\r\n\r\n\r\n\r\nTo unsubscribe from this type of email, please click here (https://browserstack.us4.list-manage.com/unsubscribe?u=fe52fcd5902732031149bbcb7&id=d86a9922bd&e=d4f1f15686&c=6138ebe0f1) .\r\nhttps://www.twitter.com/BrowserStack?utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941 https://facebook.com/browserstack?utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941 https://www.linkedin.com/company/browserstack/?utm_source=Browserstack&utm_campaign=6138ebe0f1-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-6138ebe0f1-344571941\r\n\r\n\r\n\r\n© 2021 BrowserStack Inc., 444 De Haro Street, Suite 212, San Francisco, CA 94107\r\n\r\n============================================================', 11, 'a:0:{}', 0, 0),
(12, 0, '2021-08-24 12:50:06', '\r\n            \r\n\r\nRun Parallel Tests On 40+ Browsers\r\n==================================\r\n  \r\nToday, we’re live with a highly requested add-on to extend automation testing capabilities of our platform. We’re thrilled to announce thatLambdaTest now supports Cypress.    \r\n       https://www.lambdatest.com/support/docs/getting-started-with-cypress-testing/  View Documentation [ https://www.lambdatest.com/support/docs/getting-started-with-cypress-testing/ ]       \r\n     \r\nBrowsers We Support for Cypress Testing  \r\nTest on 40+ browser versions across Windows and macOS Platforms.       \r\n      \r\nGoogle Chrome \r\n66 & above   \r\n  \r\nMozilla Firefox \r\n60 & above   \r\n  \r\nMicrosoft Edge \r\n80 & above       \r\n     \r\n\r\n### \r\n\r\nWhy run Cypress tests on LambdaTest Grid?\r\n          \r\n \r\nParallel test execution - Run your Cypress test across multiple browser & operating systems combinations, simultaneously.    \r\n    \r\n \r\nRun tests directly from the command line with powerful CLI arguments.    \r\n    \r\n \r\nDetailed analytics and test reports.        \r\n     \r\nHow To Get Started Cypress Automation?       \r\n      \r\n\r\n### \r\n\r\nInstall\r\n \r\nLambdaTest \r\nCypress CLI   \r\n  \r\n\r\n### \r\n\r\nConfiguration\r\n \r\nOf JSON file & Test \r\nEnviroment   \r\n  \r\n\r\n### \r\n\r\nRun Test\r\n \r\nWhy LambdaTest \r\nCypress Runner   \r\n  \r\n\r\n### \r\n\r\nMonitor\r\n \r\nYour Cypress Automation \r\nTest on Dashboard       \r\n       https://www.npmjs.com/package/lambdatest-cypress-cli  Check npm Package [ https://www.npmjs.com/package/lambdatest-cypress-cli ]       \r\n  \r\nSo what’re you waiting for?  \r\nPlug your Cypress tests on LambdaTest with LambdaTest Cypress CLI to extend the browser coverage test suites now!        \r\nGot Questions? Please don\'t hesitate to contact our 24/7 support center at \r\nsupport@lambdatest.com   https://www.facebook.com/lambdatest/    https://twitter.com/Lambdatesting    https://www.linkedin.com/company/lambdatest/    https://www.youtube.com/channel/UCCymWVaTozpEng_ep0mdUyw?sub_confirmation=1  \r\n  https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f2149f8ea&sd=13f52e3f21466beb&n=11699e4c26255ea  Click here to Unsubscribe [ https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f2149f8ea&sd=13f52e3f21466beb&n=11699e4c26255ea ]       \r\n\r\n', 12, 'a:0:{}', 0, 0),
(13, 0, '2021-08-24 12:50:06', '\r\n               \r\n       https://www.lambdatest.com/webinar/understanding-specflow-framework-and-running-tests-on-cloud-selenium-grid  SAVE YOUR SEAT [ https://www.lambdatest.com/webinar/understanding-specflow-framework-and-running-tests-on-cloud-selenium-grid ]       \r\n     \r\nHi Asif ,  \r\nSoftware development processes have evolved a lot and this is where Behavior Driven Development (BDD) comes in. BDD plays an instrumental role as it minimizes the communication gap between the key stakeholders of any software project i.e. product owners, developers, testers, etc.  \r\nWe\'re excited to have Andreas Willich (Community manager - SpecFlow) as our guest in this webinar to demonstrate how to proficiently perform BDD testing using Specflow & LambdaTest.  \r\n\r\n### \r\n\r\nWhat will you learn?\r\n \r\n * Getting started with Selenium and SpecFlow (or Introduction to SpecFlow) \r\n* Why SpecFlow over other BDD frameworks \r\n* Organize and create well-maintained BDD tests with SpecFlow \r\n* Overview of SpecFlow+ (LivingDoc, Runner, Excel) and SpecMap \r\n* Expedite cross browser testing with SpecFlow and LambdaTest \r\n* Need for Speed - Parallel Execution (Demo) \r\n * SpecFlow and NUnit \r\n* SpecFlow and SpecFlow+Runner   \r\n\r\nKnow Your Speaker \r\nAndreas Willich works as a community manager and scrum master in the SpecFlow team. He is one of the first SpecFlow users and has been applying BDD in small and large development projects for the last 10 years. In his, role Andreas monitors GitHub activity and community needs/contributions very closely. He\'s also an active Microsoft MVP.       https://www.lambdatest.com/webinar/understanding-specflow-framework-and-running-tests-on-cloud-selenium-grid  REGISTER NOW [ https://www.lambdatest.com/webinar/understanding-specflow-framework-and-running-tests-on-cloud-selenium-grid ]              \r\nGot Questions? Please don\'t hesitate to contact our 24/7 support center at \r\nsupport@lambdatest.com   https://www.facebook.com/lambdatest/    https://twitter.com/Lambdatesting    https://www.linkedin.com/company/lambdatest/    https://www.youtube.com/channel/UCCymWVaTozpEng_ep0mdUyw?sub_confirmation=1  \r\n  {{UnsubscribeURL}}  Click here to Unsubscribe [ {{UnsubscribeURL}} ]       \r\n\r\n\r\n\r\n\r\n----------------------------------------------------------------------\r\nThis email was sent by sarah@lambdatestteam.com to php.asif@wingshieldtechnologies.com\r\n\r\nNot interested?Unsubscribe - https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f21512630&sd=13f52e3f21501c01&n=11699e4c2d51b9e\r\n\r\nUpdate profile -  https://mgqx.maillist-manage.com/ua/upc?upd=13f52e3f1e3655a6&r=13f52e3f21512630&n=11699e4c2d51b9e&od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&r=13f52e3f21512630&n=11699e4c2d51b9e&od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016\r\n   \r\n\r\n\r\n\r\nLambdaTest | SanFrancisco \r\n\r\n\r\n\r\nOur Privacy Policy [  ] and Terms of Use. [  ] \r\n', 13, 'a:0:{}', 0, 0),
