(15, 0, '2021-08-24 12:50:07', 'To view this email as a web page, go to the following address: https://lp.activtrak.com/index.php/email/emailWebview?mkt_tok=ODM5LVRRTS04ODMAAAF9rF9oykxKKq5xk-u59lAVre2BuqWmPwjKaTL_3vEA-XR9KxpzP_tLKNpgZd7U5SiROPxcZNuF5br4ZQWXjblEb3yNokLCSjLCFHF3Zg_O&md_id=6582\r\n\r\nLog in→ <https xss=removed>\r\nWith more and more people returning to the office, new challenges are arising for organizations to understand how these changes impact productivity. That\'s why our team has been hard at work releasing key product updates to make this transition easier for you and your teams, wherever they work.\r\nRead on to learn more!\r\nNew Email Subscription Options!\r\nWe\'ve made sharing ActivTrak insights easier than ever to help you build a culture of transparency and continuous productivity improvement.\r\n\r\n\r\nPremium users can now create email subscriptions for any ActivTrak user in their organization and share snapshots of Insights Dashboards on a daily, weekly, or monthly basis - helping everyone work wiser.\r\nLearn more <https xss=removed>\r\nHaven\'t tried Premium yet? Request a free trial now→ <https xss=removed>\r\nNew Time-Saving Admin Enhancements!\r\nWe\'ve added a number of enhancements to make it easier and faster for Administrators to create groups, add users and computers, search across data fields, identify inactive users and computers, and more!\r\nSee what\'s new <https xss=removed>\r\nPremium Spotlight: Learning Hub\r\nWe want you to get the most of our analytics and insights. From guiding you through the app to providing coaching opportunities and resources, we\'re here to help. Exclusive to the Premium Plan, our Learning Hub has everything you need to unlock your organization\'s\' productivity potential.\r\nCheck it out <https xss=removed>\r\nKey Product Updates\r\nWindows 8.1.19 \r\nis now available!\r\nThis release delivers performance enhancements for terminal servers, a bug fix for installing the agent with the Chrome assistant, and stability enhancements for logging.\r\n\r\n\r\nLearn more→ <https xss=removed>\r\nON-DEMAND WEBCAST\r\nA Manager\'s Playbook for Using ActivTrak\r\nSpend less time reporting on data and more time using it. Gabriela Mauch, Head of ActivTrak\'s Productivity Lab, shares a practical playbook that managers can quickly tap into to make their goals easier to achieve, and work more enjoyable for everyone.\r\n\r\n\r\nWatch now→ <https xss=removed>\r\nNEW BLOG POST\r\nHow to Hold a \"Ways of Working\" Discussion\r\nWhether in the office, distributed, or fully remote, teams can benefit from openly discussing their working habits and aligning on expectations in order to elevate the entire team\'s collaboration style, productivity, and performance.\r\n\r\n\r\nLearn how to start the conversation→ <https xss=removed>\r\nYour valuable productivity insights in ActivTrak are meant to be shared and used by company leaders, managers, teams, and individuals. \r\nJoin our product training webcast on June 17th and learn how you can:\r\n\r\n\r\n - Easily create and update groups to provide visibility for team leaders\r\n - Gain better control over data access with the ability to tailor feature access by role\r\n - Get a head start on sharing key reports with new ActivConnect templates\r\n - Provide regular updates by scheduling reports via email or exporting to .pdf\r\n - Schedule personal productivity reports for individuals, even if they aren’t app users\r\nRegister Now→ <https xss=removed>\r\nIn case you missed it:\r\n- You can now bulk delete groups in ActivTrak. Learn how→ <https xss=removed>\r\n\r\n\r\n\r\n\r\n - Is your team working too much? How do you know? Learn how to identify burnout risk→ <https xss=removed>\r\n\r\n\r\n\r\n\r\n - Ever wonder how your team is working in comparison to similar teams? Find out with Team Comparisons→ <https xss=removed> <https xss=removed>\r\nWe\'re here to help.\r\nNeed additional assistance?\r\nContact Us <mailto>\r\nVisit Help Cent