(17, 0, '2021-08-24 12:50:08', '\r\n Greetings from Zoho Payroll!              https://www.zoho.com/in/payroll/   \r\n  https://payroll.zoho.in/ Access now    \r\n   Hey there!  You\'ve had a great start with Zoho Payroll by setting up your organization\'s basic details. To get the best results from our software, we want to help you set up the system correctly.  Here\'s how:  \r\n 1. Open Zoho Payroll and log in to your organization.  \r\n2. Head over to the settings icon in the top right corner.  \r\n3. Click the Taxes tab, and fill out the form. Your company\'s PAN, TAN, and TDS is needed to generate Form 16.  \r\n4. Now, head over to the Pay schedule tab, and choose your organization\'s pay day.      https://payroll.zoho.in/switch?organization_id=$[PT:PR_ORG_ID#8006682316140||]$&redirect_url=/app#/settings/orgprofile  Access Payroll Settings [ https://payroll.zoho.in/switch?organization_id=$[PT:PR_ORG_ID#8006682316140||]$&redirect_url=/app#/settings/orgprofile ]  That\'s it! Great going for now. Keep an eye out for our next email to help you through the next steps.  Cheers,  Zoho Payroll                         USA : +1 (888) 900 9646|    UK : +44 (20) 35647890|    Australia : +61-2-80662898|    India : +91-44-67447000 This email was sent from  mailto:support@zohopayroll.com  support@zohopayroll.com [ mailto:support@zohopayroll.com ]to php.asif@wingshieldtechnologies.com  Zoho Corporation | 6800 Burleson Rd | Austin | Texas | USA  Not Interested?  https://zoho.maillist-manage.com/ua/optout?od=3z87ed577ec441182e21f81be3715547ff896138da7cf4c5d6cf89ce7d8b56a752&rd=174a4421fb91&sd=17482c712306&n=11699e4c102fa00  Unsubscribe [ https://zoho.maillist-manage.com/ua/optout?od=3z87ed577ec441182e21f81be3715547ff896138da7cf4c5d6cf89ce7d8b56a752&rd=174a4421fb91&sd=17482c712306&n=11699e4c102fa00 ]          \r\n\r\n', 17, 'a:0:{}', 0, 0),
