(36, 0, '2021-08-24 12:50:14', '\r\n Greetings from Zoho Payroll!              https://www.zoho.com/in/payroll/   \r\n  https://payroll.zoho.in/ Access now    \r\n   Hi,  We just wanted to remind you that your free trial for Zoho Payroll expires in five days. We don\'t want you to miss out on experiencing how simple payroll can be!  Keep going with Zoho Payroll to: \r\n 1. Save time processing payroll  \r\n2. Maintain statutory compliance  \r\n3. Streamline payroll administration  \r\n4. Pay employees on time, every time    If you have not yet subscribed to a paid plan, upgrade now to enjoy uninterrupted access.    https://payroll.zoho.in/  Upgrade now [ https://payroll.zoho.in/ ]  For any payroll questions or suggestions, write to us at  mailto:support@zohopayroll.com  support@zohopayroll.com [ mailto:support@zohopayroll.com ], and we\'d be happy to help.  Cheers,  Ganesh Subramanian                         USA : +1 (888) 900 9646|    UK : +44 (20) 35647890|    Australia : +61-2-80662898|    India : +91-44-67447000 This email was sent from  mailto:ganesh.s@zohocorp.com  ganesh.s@zohocorp.com [ mailto:ganesh.s@zohocorp.com ]to php.asif@wingshieldtechnologies.com  Zoho Corporation | 6800 Burleson Rd | Austin | Texas | USA  Not Interested?  https://zoho.campaign-view.com/ua/optout?od=3z87ed577ec441182e21f81be3715547ff896138da7cf4c5d6cf89ce7d8b56a752&rd=174a7b619afb&sd=17482cdc161c&n=11699e4becdda0f  Unsubscribe [ https://zoho.campaign-view.com/ua/optout?od=3z87ed577ec441182e21f81be3715547ff896138da7cf4c5d6cf89ce7d8b56a752&rd=174a7b619afb&sd=17482cdc161c&n=11699e4becdda0f ]          \r\n\r\n', 36, 'a:0:{}', 0, 0),
(37, 0, '2021-08-24 12:50:14', 'To view this email as a web page, go to the following address: https://lp.activtrak.com/index.php/email/emailWebview?mkt_tok=ODM5LVRRTS04ODMAAAF-TBGQUj6WI9UkQLqaOv9BBXzbHZsq3y68yWJ9DLLz3PucevPFaCxLdfwBoK51rjF2zReLx2Z5TORX4JZqTLvfb-ycOYKYLPec22rkdhLF&md_id=6863\r\n\r\nLog in→ <https xss=removed>\r\nIn a recent survey by our very own Productivity Lab, organizations indicated that managerial coaching was a top area of concern. Guided by these findings, we’ve recently launched new product features that make data-driven coaching easier. Read on to learn more!\r\nMeet ActivTrak Coach!\r\nNow available in ActivTrak Premium\r\nOur new virtual productivity coach, ActivTrak Coach, is an evolution in workforce analytics. It translates data about employees’ work habits into focused actions for managers, so they can proactively offer support where it\'s needed most. \r\n\r\n\r\nEach week, ActivTrak Coach analyzes your team’s data and highlights potential issues like \r\nburnout risk, waning productivity, and low focus. And, coaching recommendations tailored to your team’s work habits provide a clear course of action to improve team productivity and well-being.\r\n\r\n\r\nVisit the new Coaching \r\ntab <https xss=removed> in your ActivTrak account, and explore the resources below for more information.\r\n\r\n\r\n\r\n\r\n - Blog: Enable Managers to Unlock Employee Productivity Potential with ActivTrak Coach→ <https xss=removed>\r\n - Read the Release Notes→ <https xss=removed>\r\n - Explore Help Center Articles→ <https xss=removed>\r\n - Try Coach by requesting a free trial of \r\nPremium→ <https xss=removed>\r\nJoin our product training webcast on July 28 and learn how new ActivTrak Coach can help you:\r\n\r\n\r\n - Identify and validate potential issues like burnout risk, waning productivity, or low focus— before they become serious problems.\r\n\r\n - Drive collaborative discussions with team members.\r\n\r\n - Assess the impact of coaching on team behavior.\r\n\r\n - Stay on top of emerging trends via weekly insights delivered to your inbox.\r\nRegister Now→ <https xss=removed>\r\nActivTrak + your software stack = powerful insights!\r\nNow available for both Advanced and Premium plans, ActivConnect <https xss=removed> enables the ability to access your ActivTrak data in hundreds of external applications. It includes a cloud-based SQL query interface, API compatibility with business and analytic software, BI starter templates for Microsoft Power BI, Tableau, Google Data Studio, and more.\r\n\r\n\r\nTake ActivConnect Premium for a spin→ <https xss=removed>\r\nCheck out what’s available in our new Premium views→ <https xss=removed>\r\nGet more control over data access \r\nwithin your account\r\nWith our new Role Access functionality, Admins have more granular control over User Role permissions, so \r\naccess to ActivTrak can be granted to more people in the organization, without the risk of exposing sensitive information. Visit the Role Access page (Settings > Access > Role Access) and reference this article <https xss=removed> to get started.\r\nLearn more <https xss=removed>\r\nKey Product Updates\r\nBulk Groups\r\nSave time managing Groups and Group assignments. Onboard new users faster by creating groups and assigning users within a spreadsheet – all in one effort – then upload to ActivTrak.\r\n\r\n\r\nLearn more→ <https xss=removed>\r\nAgent Page Migration\r\nOur User Agents page is receiving a facelift! We will be introducing standalone Users and Computers pages leveraging an intuitive and flexible design to make it easier and faster for Admins to add users and computers and search across data fields.\r\n\r\n\r\nComing soon!\r\nSURVEY RESULTS\r\nHybrid Work is Here to Stay and Managerial Coaching is Top Concern\r\nRead full results→ <https xss=removed>\r\nNEW BLOG POST\r\nThree Guiding Principles for Leading \r\nRemote Teams\r\nLearn how to build and sustain a remote or hybrid workplace that inspires innovation, drives engagement, and cultivates success.\r\n\r\n\r\nLearn more→ <https xss=removed>\r\nNEW BLOG POST\r\nWork from home tips and tools for employees\r\nAs a remote-first company, we celebrated National Work From Home Day with remote work tips from our very own team.\r\n\r\n\r\nSee what they recommended→ <https xss=removed>\r\nIn case you missed it:\r\n- The 5 Essential Reports for Managers: What to Review Daily, Weekly, and Monthly. Learn more→ <https xss=removed>\r\n\r\n\r\n\r\n\r\n - Learn to leverage ActivTrak data to help your team work wiser with the Learning Hub. Check it out→ <https xss=removed>\r\n\r\n\r\n\r\n\r\n - Find sources of distraction and reclaim time for focused work by referencing the Inefficiency Sources report. Learn how→ <https xss=removed> <https xss=removed>\r\nWe\'re here to help.\r\nNeed additional assistance?\r\nContact Us <mailto>\r\nVisit Help Center <https xss=removed>\r\nActivTrak \r\n 3101 Bee Caves Rd., Suite 200 Austin, TX 78746\r\n\r\n This email was sent to php.asif@wingshieldtechnologies.com <https xss=removed>, if you no longer want to receive emails, unsubscribe here &lt;[[https://lp.activtrak.com/UnsubscribePage.html?mkt_unsubscribe=1&mkt_tok=ODM5LVRRTS04ODMAAAF-TBGQUj6WI9UkQLqaOv9BBXzbHZsq3y68yWJ9DLLz3PucevPFaCxLdfwBoK51rjF2zReLx2Z5TORX4JZqTLvfb-ycOYKYLPec22rkdhLF]]>. \r\n\r\n Copyright © 2021 ActivTrak. All rights reserved.\r\n', 37, 'a:0:{}', 0, 0),
(38, 0, '2021-08-24 12:50:14', 'Learn more  How Startups and SMBs in India are Revolutionizing HR Processes? In this era of digital evolution and technological advancement, automation has become an integral part of the growth and furtherance of any organization. Most companies struggle to manage their huge workforce and their databases.  ﻿Also, during the processing of payroll, HR goes through a lot of tedious processes to streamline monthly payments and managing tax and legal compliances. This is where the need for HRMS solutions comes into the picture to seamlessly deliver all your HR needs.   Read More ‌ ‌ ‌ ‌ ‌ ‌ ZingHR | Quantum Towers, Mumbai, Maharashtra India, Mumbai, 400064 India Unsubscribe php.asif@wingshieldtechnologies.com Update Profile | Constant Contact Data Notice Sent by team@zinghr.com', 38, 'a:0:{}', 0, 0);
