(42, 0, '2021-08-24 12:50:15', 'View in Browser &lt;[[https://lp.activtrak.com/index.php/email/emailWebview?mkt_tok=ODM5LVRRTS04ODMAAAF-YJAYN7_sN_Iy-NUC4inC3-di5weBtiDw4IuF1l0MJkXijyj3Qpg23GrIA9GQKSuMxOLk-Ouaw0qfjJxKlggDSV7mJJoqALemIxFODhsH&md_id=6920]]>\r\nThe role of the manager is critical in ensuring teams are working efficiently, are focused on the right priorities, and have the support they need to navigate obstacles. But, managers need the right data to ensure they have visibility into potential issues before they become big problems.\r\n\r\n\r\nNew ActivTrak Coach <https Dr5YQSxqhHRo7JuSVKlBBXc7UCld-QJitLM5deawy7b08BFbKJiosL83RLeFbGxolb1wFQbb3t360c08_QbNx_MAZllkeoIV54RS1rrORaw=/ODM5LVRRTS04ODMAAAF-YJAYN9n9Em9nrZnpTP4VIIoTjZj0d1IW8-d3F9_rpjYEgDaHd9JEzNJQmBBXfZIxqEMd2Lk>, automatically analyzes your team’s data and surfaces insights that need attention so managers can proactively engage with team members who need support.\r\n\r\n\r\nJoin our webcast on Wednesday, July 28 at 10 a.m. CT to learn how ActivTrak Coach can help you:\r\n\r\n\r\n - Identify and validate potential issues — like burnout risk, waning productivity, or low focus— before they become serious problems.\r\n - Drive collaborative discussions with team members.\r\n - Assess the impact of coaching on team behavior.\r\n - Stay on top of emerging trends via weekly insights delivered to your inbox\r\nWednesday, July 28th\r\n10:00 AM CT\r\nREGISTER NOW <https Dr5YQSxqhHRo7JuSVKlBBU8iDntOERGvrZ6yLbMT-F03sDvall6oWP-cn27BTxJKPcKYP8e3MaZJmzH1jTspMICMCRqP5XqW21ohWQAntZk=/ODM5LVRRTS04ODMAAAF-YJAYN9n9Em9nrZnpTP4VIIoTjZj0d1IW8-d3F9_rpjYEgDaHd9JEzNJQmBBXfZIxqEMd2Lk>\r\nAccess powerful insights to empower your team.\r\nTry ActivTrak Premium <https xss=removed xss=removed> for free!\r\nActivTrak \r\n 3101 Bee Caves Rd., Suite 200 Austin, TX 78746\r\n\r\n This email was sent to php.asif@wingshieldtechnologies.com <https xss=removed>, if you no longer want to receive emails, unsubscribe here &lt;[[https://lp.activtrak.com/UnsubscribePage.html?mkt_unsubscribe=1&mkt_tok=ODM5LVRRTS04ODMAAAF-YJAYN7_sN_Iy-NUC4inC3-di5weBtiDw4IuF1l0MJkXijyj3Qpg23GrIA9GQKSuMxOLk-Ouaw0qfjJxKlggDSV7mJJoqALemIxFODhsH]]>. \r\n\r\n Copyright © 2021 ActivTrak. All rights reserved.\r\n', 42, 'a:0:{}', 0, 0),
