(51, 0, '2021-08-24 12:50:17', 'Dear Sir, \r\n\r\nThis is reference to below mail, we require a initial call with you for understanding your exact requirement. After your input we will be able to give suitable solution for their requirement. Please share your Contact no. for discuss of their requirement. Please revert back asap. \r\n\r\n\r\nWarm regards \r\n\r\nDeepesh Gupta \r\nSenior Sales Executive \r\nTetra Information Services Pvt. Ltd. \r\n252 H,First Floor,Kailash Plaza, Sant Nagar, \r\nEast of Kailash, \r\nNew Delhi - 110065, India. \r\nEmail : deepesh@tetrain.com,Website : www.tetrain.com \r\nPhone : 91-11-46571313 \r\nMobile: 9667180367, 7891789516 \r\n\r\n\r\nFrom: \"DEEPESH GUPTA\" <deepesh> \r\nTo: \"php asif\" <php> \r\nCc: \"Mukul Mahajan\" <mukul> \r\nSent: Tuesday, June 22, 2021 1:50:38 PM \r\nSubject: V-tiger Requirement \r\n\r\nDear Mr. Asif, \r\n\r\nGreetings of the Day, \r\n\r\nThanks for the query. \r\n\r\nAs per telephonic discussion with you, I am sharing with you V-tiger Presentation for their review. Please find attachment document in this file. \r\n\r\nWarm regards \r\n\r\nDeepesh Gupta \r\nSenior Sales Executive \r\nTetra Information Services Pvt. Ltd. \r\n252 H,First Floor,Kailash Plaza, Sant Nagar, \r\nEast of Kailash, \r\nNew Delhi - 110065, India. \r\nEmail : deepesh@tetrain.com,Website : www.tetrain.com \r\nPhone : 91-11-46571313 \r\nMobile: 9667180367, 7891789516 \r\n\r\n', 51, 'a:0:{}', 0, 0),
(52, 0, '2021-08-24 12:50:17', 'Hi,\r\n\r\nSay hello to the Vtiger Application Platform (VTAP)!\r\n\r\nVTAP empowers developers and administrators to extend the CRM functionality \r\nto quickly deliver custom flows and unique requirements of businesses. \r\n[Read more \r\n](https://vtigerecs.od1.vtiger.com/shorturl.php?id=60fff54fcb6089.29571755&rid=C149227140&redirurl=https://bit.ly/3BVQzJg&type=click&redirtxt=Read+more+&rv=0c5fd36b7dc8a7d81d7173c63c0d2928).\r\n\r\nThis dispatch also contains the following:   CRM Trends in 2021:&nbsp; \r\nMobile CRM   Product Updates   LinkedIn integration:&nbsp;Vtiger&#039;s \r\nLinkedIn integration empowers you to turn your LinkedIn profile into a \r\ntreasure trove of leads.    Interesting Reads   Alerts &amp; Notifications: \r\nYour New Best Friends in the Remote World   eBook: Artificial Intelligence \r\nin Sales (A strategic perspective)\r\n[Learn more \r\n](https://vtigerecs.od1.vtiger.com/shorturl.php?id=60fff54fcb6089.29571755&rid=C149227140&redirurl=https://bit.ly/2WpsYjQ&type=click&redirtxt=Learn+more+&rv=923fbac23182be9653eeb31c8f0fe62e)\r\n22028 Lindy Lane | Cupertino, CA 95014\r\nYou&#039;re receiving this email because you have opted into our email \r\nlist.\r\n2021 &copy; Vtiger Systems All rights reserved | [Email Preferences \r\n](https://vtigerecs.od1.vtiger.com/shorturl.php?id=60fff8775a21c5.47064821) \r\n| [Unsubscribe \r\n](https://vtigerecs.od1.vtiger.com/shorturl.php?id=60fff8775a21c5.47064821)', 52, 'a:0:{}', 0, 0),
(53, 0, '2021-08-24 12:50:18', 'Each week on Breaking Changes, Postman Chief Evangelist Kin Lane hosts stellar guests from all across the API universe to discuss, debate, and solve the latest issues and topics around APIs.\r\n\r\nIn each episode of Breaking Changes, you\'ll:\r\n\r\n\r\n - Get insights into the latest happenings in the API industry\r\n - Learn from the experiences and API journeys of practitioners and organizations\r\n - Discover new ways to think about API design, architecture, strategy, and developer experience\r\n\r\n\r\n\r\nSo bring your API enthusiasm and Subscribe to the show to receive exclusive content covering different perspectives, industry news, and behind-the-scenes stories.\r\n\r\n\r\n--&gt;> Subscribe Now - https://www.postman.com/events/breaking-changes/\r\n\r\n- Featuring Tanya Vlahovic of eBay Learn how eBay, long established as an API pioneer, joined the OpenAPI Initiative and adopted AsyncAPI to stay agile and competitive in the digital marketplace. \r\nAdd to Calendar: https://www.addevent.com/event/Oo7560063\r\n\r\n- Learn how Musser’s team is innovatively leveraging APIs to deliver the next generation of experiences and connected vehicles in the automotive industry.\r\nAdd to Calendar: https://www.addevent.com/event/eE7689905\r\n\r\n- Kelly will discuss his innovative work on healthcare APIs as part of the Colorado state government\'s response to a recent ruling by the Centers for Medicare & Medicaid Services (CMS.\r\nAdd to Calendar: https://www.addevent.com/event/VE7689906\r\n\r\n\r\n\r\n\r\n-\r\n', 53, 'a:0:{}', 0, 0),
(54, 0, '2021-08-24 12:50:18', 'Join Derek Ross as he addresses how to create a scaled pipeline with a mobile-first design\r\n\r\nWEBINAR\r\nhttps://www.browserstack.com/webinars/scaling-your-mobile-testing-strategy?utm_source=email&utm_medium=email&utm_campaign=unattributed&utm_source=Browserstack&utm_campaign=d5eec7003f-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-d5eec7003f-344571941\r\n\r\nDeveloping a mobile testing strategy that fully validates your user experience is challenging. What test creation strategy works best? Which test automation frameworks should you choose, and why? How do you create a continuous delivery pipeline that best serves all the people and the processes involved in the delivery chain? In this webinar, Derek Ross, a Lead Solutions Engineer at BrowserStack, with 10+ years of experience will be addressing these questions.\r\n\r\nHere’s what you\'ll take home:\r\n*  How Appium, XCUI or Espresso can be run at scale with BrowserStack\r\n* CI/CD best practices to consider for your teams and common pitfalls that are related to building CI/CD pipelines\r\n* Know the pros and cons of scaling internally vs externally with BrowserStack\r\n\r\nJoin us at 8 AM PT | 3 PM UTC on 10th August, 2021. Think you can\'t make it? Register anyway and we\'ll send you the recording\r\n\r\nKnow someone who\'d be interested? Invite them by clicking here (mailto:abc@xyz.com?subject=Here’s a webinar on mobile testing you might be interested in&body=Hey, I just found a free webinar by BrowserStack which you may find useful. It will cover topics like, How Appium, XCUI or Espresso can be run at scale with BrowserStack? CI/CD best practices to consider for your teams and common pitfalls that are related to building CI/CD pipelines? etc. It is on August 10, 2021, at 8:00 AM PT | 3.00 PM UTC. Register here: https://www.browserstack.com/webinars/scaling-your-mobile-testing-strategy\n\nCheers,)\r\nRegister now (https://www.browserstack.com/webinars/scaling-your-mobile-testing-strategy?utm_source=email&utm_medium=email&utm_campaign=unattributed&utm_source=Browserstack&utm_campaign=d5eec7003f-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-d5eec7003f-344571941)\r\n\r\nSee you there,\r\nTeam BrowserStack\r\n\r\n\r\n\r\nTo unsubscribe from this type of email, please click here (https://browserstack.us4.list-manage.com/unsubscribe?u=fe52fcd5902732031149bbcb7&id=d86a9922bd&e=d4f1f15686&c=d5eec7003f) .\r\nhttps://www.twitter.com/BrowserStack?utm_source=Browserstack&utm_campaign=d5eec7003f-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-d5eec7003f-344571941 https://facebook.com/browserstack?utm_source=Browserstack&utm_campaign=d5eec7003f-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-d5eec7003f-344571941 https://www.linkedin.com/company/browserstack/?utm_source=Browserstack&utm_campaign=d5eec7003f-EMAIL_CAMPAIGN_2020_01_17_08_58_COPY_01&utm_medium=email&utm_term=0_d86a9922bd-d5eec7003f-344571941\r\n\r\n\r\n\r\n© 2021 BrowserStack Inc., 444 De Haro Street, Suite 212, San Francisco, CA 94107\r\n\r\n============================================================', 54, 'a:0:{}', 0, 0),
