(58, 0, '2021-08-24 12:50:19', 'We have several important items that require your attention, and may require you to take action in a timely manner.\r\n\r\nZoom Sign In\r\nhttp://click.zoom.us/e/84442/signin-zcid-1640/c3ldbp/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nDear Zoom Developer,\r\nOn August 7, 2021, Zoom will remove the Data Compliance requirements for publishing apps to the Zoom App Marketplace, and update the Marketplace Developer Agreement.\r\nhttp://click.zoom.us/e/84442/2021-07-28/c3ldbr/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\nhttp://click.zoom.us/e/84442/arketplace-developer-agreement/c3ldbt/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nThree (3) important changes to be aware of\r\n\r\nZoom is fully deprecating the Data Compliance API. It will no longer accept requests when this change is released to production.\r\nhttp://click.zoom.us/e/84442/nce-data-compliance-compliance/c3ldbw/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nZoom is removing the user_data_retention Boolean property from App Deauthorization events when this change is released to production. Please note that all other properties pertaining to App Deauthorization events will remain as-is.\r\nhttp://click.zoom.us/e/84442/ce-app-events-app-deauthorized/c3ldby/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nZoom will be updating the Marketplace Developer Agreement to reflect these changes: specifically, developers will no longer have to delete End User Data within ten days after an end user uninstalls the developer’s app – and therefore won’t be required to notify Zoom of that deletion. Developers are still required to comply with data deletion requests from end users in accordance with applicable law.\r\nhttp://click.zoom.us/e/84442/arketplace-developer-agreement/c3ldbt/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nWhy is Zoom changing this requirement?\r\nWe’re making this change to better align developers’ data deletion obligations regarding user data with applicable law, and to make developing with the Zoom App Marketplace more transparent for the mutual customers shared by both Zoom and our Marketplace developers.\r\n\r\nWhat is the impact of this change?\r\nThis change only impacts apps published on the Zoom App Marketplace.\r\nIf you have not yet published your app, but plan on publishing it soon, please see the steps below to prepare your app for this change prior to publishing.\r\nIf you have not published an app publicly on the App Marketplace, and do not plan to, you will not be affected by the removal of the Data Compliance API.\r\n\r\nPrepare your Marketplace app\r\nIf you are a developer that has built and published an app on the Zoom App Marketplace since the Marketplace launched in October 2018, or if you plan to release an app soon, you must do the following to prepare your published Marketplace App for this change to ensure that your app continues to operate:\r\n1. Remove any code that expects the user_data_retention property to be present or stored by name in your database.\r\n2. Remove any code that listens for the user_data_retention property.\r\n3. Remove any code that executes HTTP POST requests to the Data Compliance API Endpoint at http://click.zoom.us/e/84442/oauth-data-compliance-/c3ldc1/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nWe also recommend that you log in to your marketplace account, and select “Manage”. If you have not accepted the most up-to-date Marketplace Developer Agreement, you will be prompted to do so at that time.\r\n\r\nFor any questions or assistance with these changes, please contact Developer Support or use our Developer Forum. Priority support is also available with Premier Developer Support.\r\nhttp://click.zoom.us/e/84442/2021-07-28/c3ldc3/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\nhttp://click.zoom.us/e/84442/2021-07-28/c3ldc5/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\nhttp://click.zoom.us/e/84442/s-developer-support-plans-html/c3ldc7/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nThank you!\r\n#codehappy\r\n\r\nhttp://click.zoom.us/e/84442/Zoom/c3ldc9/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\nhttp://click.zoom.us/e/84442/any-zoom-video-communications-/c3ldcc/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\nhttp://click.zoom.us/e/84442/2021-07-28/c3ldcf/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\n+1.888.799.9666\r\ntel:1-888-799-9666\r\n\r\n© 2021 Zoom - All Rights Reserved\r\n\r\nVisit zoom.us\r\nhttp://click.zoom.us/e/84442/2021-07-28/c3ldch/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\n55 Almaden Blvd\r\nSan Jose, CA 95113\r\n\r\nhttp://click.zoom.us/e/84442/38m23d37-33285414d-121-8949083/c3ldck/3487931490?h=mcenomgPl-mzRgyKBkI7r0RIVZerKP_5VBUnxEsyr5M\r\n\r\nYou\'re receiving this email because you signed up for a Zoom account.\r\nIf you wish to be removed from our email list, unsubscribe\r\nhttp://click.zoom.us/emailPreference/e/epc/84442/HDSwxx10iqtBVFmHdYeJconnh4tTvlrDW8vxXsdFdcs/654/33092069f1bf9117c60164e0332503d63a464d0deab5e94d81c25a5211c6bc29/3487931490\r\n', 58, 'a:0:{}', 0, 0),
