(63, 0, '2021-08-24 12:50:20', '\r\nHi there,\r\nHi there,\r\n\r\nWe’re soooo excited to announce that Postman now supports WSDL (Web Services Description Language) files. This capability has been one of the most popular feature requests from Postman users, and it adds to the multiple API specification formats that the Postman API Platform already supports.\r\n\r\nHere\'s what this news means for you: You can now use Postman’s powerful runtime, lifecycle management, and collaboration features for your WSDL-described SOAP services to achieve faster development, faster bug fixes, and more effective API collaboration.\r\n\r\nPostman Co-founder Abhijit Kane gives you all the key details, plus screenshots, in his new blog post. (https://blog.postman.com/postman-now-supports-wsdl/)\r\n\r\nNow, let’s take a look at what else Postman is bringing you this month, shall we?\r\n\r\nBREAKING NEWS ABOUT BREAKING CHANGES SHOW\r\n\r\n⦿ Subscribe to Breaking Changes and Get Access to Exclusive Content\r\n\r\nBreaking Changes is a weekly talk show where Postman Chief Evangelist Kin Lane hosts stellar guests from all across the API universe to discuss, debate, and solve the latest topics around APIs and API-first.\r\n\r\nKin will be sharing some exclusive content with the show’s subscribers every month, so we encourage you to subscribe now to get access to this hand-picked content covering different perspectives, industry news, and behind-the-scenes stories. \r\n\r\nAnd there’s more breaking news about Breaking Changes. You can now listen to every episode on these podcast platforms:\r\n- Spotify [link: https://open.spotify.com/show/5ig80ZlBLiC2iXxql0s1q2]\r\n- Apple Podcasts [link: https://podcasts.apple.com/us/podcast/breaking-changes/id1574147652]\r\n- Google Podcasts [link: https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkLnBvZGJlYW4uY29tL2JyZWFraW5nY2hhbmdlcy9mZWVkLnhtbA==]\r\n- Amazon Music [link: https://music.amazon.com/podcasts/ea40d8b4-8cbb-4061-b618-794c3bbbbd42/Breaking-Changes]\r\n\r\n\r\n--&gt;> Subscribe to Breaking Changes: https://www.postman.com/events/breaking-changes/\r\n\r\n\r\nPRODUCT UPDATES\r\n\r\n\r\n⦿ Capture Response using Postman\'s Proxy\r\n\r\nThe Postman proxy helps you debug your application by capturing HTTP traffic and creating a collection that can be shared with users, or to create documentation. Now, the latest version of Postman supports capturing responses along with requests, all for better debugging and documentation generation.\r\n\r\n--&gt;> Read the blog post: www.blog.postman.com/capture-responses-using-the-postman-proxy\r\n\r\n\r\nThe Postman API Network\r\n\r\n⦿ Browse Stripe’s New Postman Public Workspace\r\nWe’ve been amazed by the creativity of our developer community exploding on the Postman API Network; among other things, there is a spectacular and ever-expanding range of public workspaces. Here’s the latest example: Stripe’s new public workspace includes a frequently updated Stripe API collection with dozens of items for you to explore.\r\n\r\n--&gt;> See the Workspace: https://www.postman.com/stripedev/\r\n\r\n\r\nTHE STUDENT SUMMIT\r\n\r\n⦿ We are proud to announce the inaugural Postman Student Summit, August 7-8, 2021. \r\n\r\nThe Postman Student Summit is a free and comprehensive online API event for students and educators from all over the world to collaboratively learn, share, and create all things API. Educators and college/high school students of any experience level are invited to this global celebration of APIs.\r\n\r\nDuring the event, we’ll have talks from tech innovators at companies like Twitter and freeCodeCamp.org, a hackathon with stellar prizes, and many chances for attendees to build connections with other students interested in the rapidly expanding world of APIs.\r\n\r\n--&gt;> Register free: https://www.eventbrite.com/e/postman-student-summit-2021-tickets-161638299505\r\n\r\n\r\nPOPULAR POSTMAN RESOURCES \r\n\r\n⦿ How to Auto-Sync Postman Collections with AWS CodeCommit Repositories\r\nRead the blog post: https://blog.postman.com/how-to-auto-sync-postman-collections-with-aws-codecommit-repositories/\r\n\r\n\r\n⦿ How Nylas Uses Postman to Help Developers Adopt the Nylas API\r\nRead the blog post: https://blog.postman.com/how-nylas-uses-postman-to-help-developers-adopt-api/\r\n\r\n\r\n⦿ How to Explore the Notion API with Notion’s Postman Public Workspace\r\nRead the blog post: https://blog.postman.com/how-to-explore-notion-api-postman-public-workspace/\r\n\r\n\r\n⦿ Postman Space Camp: New Educational Trainings for Every User Type\r\nRead the blog post: https://blog.postman.com/postman-space-camp-new-educational-webinars-for-every-user-type/\r\nSubscribe to Breaking Changes and Get Access to Exclusive Content\r\n\r\n\r\n-\r\n', 63, 'a:0:{}', 0, 0),
