(70, 0, '2021-08-24 12:50:21', '﻿\r\n\r\n\r\n​\r\n\r\nHi Md,\r\n\r\n\r\nAre you a Microsoft Teams user who finds it difficult to switch between the CRM and the Team? Worry Not!\r\n\r\nVtiger has a solution! Vtiger CRM now bridges this gap by integrating with [Microsoft Teams](https://vtigerecs.od1.vtiger.com/shorturl.php?id=61116d38dbc865.44913275&rid=C149227140&redirurl=https://bit.ly/2VAunnm&type=click&redirtxt=Microsoft+Teams&rv=144960d5b5edc8c86b3c7486db674982).\r\n\r\n\r\nImprove your team collaboration with Microsoft Teams integration.\r\n\r\n\r\nThis dispatch also contains the following:\r\n\r\n\r\nNew Feature: Vtiger Confetti.We have added Confetti to the CRM, which is built using Vtigers&rsquo;s low code platform VTAP.New Integrations:Clearbit Integration - Empowers your sales team to enrich contact and lead records with contextual information.IndiaMart Integration - Capture leads data into the CRM and streamlines your sales process with automated emails. Track and monitor lead information effortlessly.Customer of the Month: PactiaVtiger&rsquo;s Print Templates and Automation tools have reduced their sales process from 2-3 months to 30 days or less.Vtiger Snippets:Grid Edit - Enables you to edit a record on the fly.\r\n[Click here to read more](https://vtigerecs.od1.vtiger.com/shorturl.php?id=61116d38dbc865.44913275&rid=C149227140&redirurl=https://bit.ly/37kkKvv&type=click&redirtxt=Click+here+to+read+more&rv=e3eb0b78feb415a8561a77fe958bf2e7)\r\n\r\n\r\n\r\n\r\n\r\n[](https://vtigerecs.od1.vtiger.com/shorturl.php?id=61116d38dbc865.44913275&rid=C149227140&redirurl=https://www.facebook.com/vtiger&type=click&redirtxt=&rv=9a3c0779bb169c01b109d2d0a3141833)​\r\n\r\n[](https://vtigerecs.od1.vtiger.com/shorturl.php?id=61116d38dbc865.44913275&rid=C149227140&redirurl=https://twitter.com/vtigercrm&type=click&redirtxt=&rv=c8d185bbbbdaad4a650a22c7f113da20)​\r\n\r\n[](https://vtigerecs.od1.vtiger.com/shorturl.php?id=61116d38dbc865.44913275&rid=C149227140&redirurl=https://www.linkedin.com/company/vtiger/&type=click&redirtxt=&rv=79300535c939f7cc41525ec7080a9f03)​22028 Lindy Lane | Cupertino, CA 95014\r\nYou&#039;re receiving this email because you have opted into our email list.\r\n2021 &copy; Vtiger Systems All rights reserved | [Email Preferences](https://vtigerecs.od1.vtiger.com/shorturl.php?id=611170ae8047c4.58306059) | [Unsubscrib](https://vtigerecs.od1.vtiger.com/shorturl.php?id=611170ae8047c4.58306059)e', 70, 'a:0:{}', 0, 0),
(71, 0, '2021-08-24 12:50:21', 'To view this email as a web page, go to the following address: https://lp.activtrak.com/index.php/email/emailWebview?mkt_tok=ODM5LVRRTS04ODMAAAF-zOxGOMA7Zz426MkTMYhKthee_NIY2Q3-sV5EpBSFD4JFPUL1WwgrUNvbllFa_vr4GbmqxONNm49-PTDgYNWIZLDy-__jh92vBJIMDEOX&md_id=7160\r\n\r\nLog in→ <https xss=removed>\r\nAs remote and hybrid work continues to dominate headlines, our team has been hard at work developing features and enhancements that make improving productivity easier for everyone, everywhere. \r\nRead on to learn more!\r\nPersonal Insights at Your Fingertips!\r\nNow it\'s even easier to deliver \'Insights for Everyone\'\r\nThe Personal Insights Dashboard empowers employees to play an active role in their professional development. We\'ve added it to the Insights section within the left app navigation to make it easier to review your own Personal Insights regularly and share the dashboard with team members.\r\n\r\n\r\nWithin the Personal Insights Dashboard, you\'ll find new metrics and reporting views, including a new \"Key Metrics by Day\" section to provide a daily breakdown of how employees spent their time versus the previous week.\r\n\r\n\r\nRead the release notes to learn more→ <https xss=removed>\r\nVisit the Personal Insights Dashboard→ <https xss=removed>\r\nNew Computer Agents Page is Coming Soon!\r\nThe Computer Agents Page will soon be its own dedicated page (separate from the Users page), with an intuitive design that allows Admins to view and export computer information and take administrative actions to delete or uninstall computer agents.\r\nNew Feature Spotlight: \r\nActivConnect Templates for Power BI\r\nNew and improved ActivConnect starter templates for Power BI can help you conduct deep analysis on your ActivTrak data with insights on productivity trends, application usage, compliance, collaboration patterns, and more.\r\nLearn more <https xss=removed>\r\nKey Product Updates\r\nmacOS Agent 8.2.4\r\nThis release includes u