(73, 0, '2021-08-24 12:50:22', '\r\n             https://www.lambdatest.com/webinar/how-digital-transformation-is-catalyzing-changes-in-automation-testing?utm_source=Website&utm_medium=Webinar&utm_campaign=10082021&utm_term=catalyzingchangesinautomation    \r\n     \r\n\r\n### \r\n\r\nBrief\r\n \r\nThe world is at the cusp of a digital transformation and digital is now considered   the   mainstay   for   building   a   formidable   competitive strategy (across different business verticals). Quality Assurance (QA)is also witnessing major changes owing to the growing emphasis laid on Automation Testing, Continuous testing, Shift-left testing, and more.  \r\n‘QA digital transformation’ and ‘QA community of practice’ have now become the key change-makers for digital-first organizations. What  does   it  takes  for   organizations   to  leverage  the  potential offered by Automation Testing, DevSecOps, and other key enablers to realize QA digital transformation?  \r\nJoin our expert Dileep Marway, a proven expert when it comes to technology systems delivery, Test/QA management and DevSecOps. He will share his insights on how organizations can charter the path of digital transformation in a more effective manner.  \r\n\r\n### \r\n\r\nWhat will you learn?\r\n​ \r\n * Why should the QA community of practices (CoP) be at the heart of a successful QA organization?  \r\n* Importance of continuous building of ‘QA digital transformation’ culture.  \r\n* How retail and publishing industries are leading from the front as far as QA digital transformation is concerned?  \r\n* How to use web based testing approaches effectively to gather vital customer feedback?  \r\n* Why should compatibility testing always be on QA’s priority list?  \r\n* Key Objectives of DevSecOps and the role of QA in the entire process.  ​      https://www.lambdatest.com/webinar/how-digital-transformation-is-catalyzing-changes-in-automation-testing?utm_source=Website&utm_medium=Webinar&utm_campaign=10082021&utm_term=catalyzingchangesinautomation  REGISTER NOW [ https://www.lambdatest.com/webinar/how-digital-transformation-is-catalyzing-changes-in-automation-testing?utm_source=Website&utm_medium=Webinar&utm_campaign=10082021&utm_term=catalyzingchangesinautomation ] \r\nHope you see you there :)      \r\n https://www.lambdatest.com/webinar/ Check out our previous webinars here           \r\nGot Questions? Please don\'t hesitate to contact our 24/7 support center at \r\nsupport@lambdatest.com ​   https://www.facebook.com/lambdatest/    https://twitter.com/Lambdatesting    https://www.linkedin.com/company/lambdatest/   https://www.youtube.com/channel/UCCymWVaTozpEng_ep0mdUyw?sub_confirmation=1  \r\nNot Interested?  https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f2435616b&sd=13f52e3f2432535f&n=11699e4c21902a2  Unsubscribe [ https://mgqx.maillist-manage.com/ua/optout?od=3z7c20a21d93bddd3f194922a7acab158405e8687335b5b3e0fc465177a9218016&rd=13f52e3f2435616b&sd=13f52e3f2432535f&n=11699e4c21902a2 ]      \r\n\r\n', 73, 'a:0:{}', 0, 0),
(74, 0, '2021-08-24 12:50:22', 'We have several important items that require your attention, and may require you to take action in a timely manner.\r\n\r\nZoom Sign In\r\nhttp://click.zoom.us/e/84442/signin-zcid-1640/c3lgyk/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\nDear Zoom Developer,\r\n\r\nWe have several upcoming updates for you to be aware of;\r\n-Android SDK version 5.7.1 Google Play Store impact\r\n-New Reports for IM Chat Sessions & Messages\r\n-Security Enhancements\r\n-Client SDK is now called Meeting SDK\r\n\r\nPlease see the sections below for additional information and any action needed.\r\n\r\nAndroid SDK version 5.7.1 Google Play Store impact\r\nGoogle Store policies do not support the APK-based update code in the Zoom Android SDK product prior to version 5.7.1. This code was inherited from the Zoom client’s code base and was never used by the SDK. However, since it exists in the SDK, Google may discover it in a scan of your app on the Play store. Zoom has removed this code in the 5.7.1 release. If your app is available on the Play Store and it uses a version prior to 5.7.1, Google may suspend your app.\r\nAction needed: Please update your app to use Android SDK version 5.7.1 or greater as soon as possible and update it on the Google Play Store.\r\n\r\nNew Reports for IM Chat Sessions & Messages\r\nAs we previously announced, we are deprecating the  Get IM chat sessions  and  Get IM chat messages of a session  APIs and will remove them as of December 2021. We have replaced these deprecated APIs with the following new  Reports  APIs:\r\n-Get chat sessions report\r\n-Get chat messages reports\r\nhttp://click.zoom.us/e/84442/ate-announcements-im-chat-apis/c3lgym/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\n Security Enhancements \r\nWe shared these security enhancements in an earlier email, but would like to share them again as a reminder. As part of our continued efforts to improve security for Zoom OAuth App Types using Authorization Flow, we released three new security features. These features went into effect on May 16, 2021. They are recommended, but not required, and will not affect your existing OAuth apps in production until May 15, 2022. On that date we will make these features mandatory. The features are: support for x-www-form-urlencoded Content-Type headers, support PKCE for authorization_code grant_type, and whitelist URLs must explicitly define subdomains.\r\nSee Zoom OAuth Security Updates for details.\r\nhttp://click.zoom.us/e/84442/e-announcements-oauth-security/c3lgyp/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\nAction strongly suggested:  Please update your API calls to set the access_token in the Authorization Header and not in the HTTP Query parameter.\r\n\r\nClient SDK is now officially ‘Meeting SDK’ \r\nTo better reflect the functionality of the Client SDK for Android, iOS, macOS, Windows, and Web, we’re changing its name to the  Meeting SDK.  This SDK has always focused on making it easy for you to integrate Zoom meetings and webinars with your apps. It’s also localizable and customizable. Find out more about Zoom Meeting SDKs.\r\nhttp://click.zoom.us/e/84442/-sdk-native-sdks-introduction-/c3lgyr/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\nFor any questions or assistance with these changes, please contact Developer Support through http://click.zoom.us/e/84442/2021-08-11/c3lgyt/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ or use our Developer Forum. Priority developer support is also available with Premier Developer Support.\r\nhttp://click.zoom.us/e/84442/2021-08-11/c3lgyw/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\nhttp://click.zoom.us/e/84442/s-developer-support-plans-html/c3lgyy/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\nThank you!\r\n#codehappy\r\n\r\nhttp://click.zoom.us/e/84442/Zoom/c3lgz1/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\nhttp://click.zoom.us/e/84442/any-zoom-video-communications-/c3lgz3/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\nhttp://click.zoom.us/e/84442/2021-08-11/c3lgz5/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\n+1.888.799.9666\r\ntel:1-888-799-9666\r\n\r\n© 2021 Zoom - All Rights Reserved\r\n\r\nVisit zoom.us\r\nhttp://click.zoom.us/e/84442/2021-08-11/c3lgz7/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\n55 Almaden Blvd\r\nSan Jose, CA 95113\r\n\r\nhttp://click.zoom.us/e/84442/38m23d37-33285414d-121-8949083/c3lgz9/3502022752?h=ghFzXn5XY-yqUmSNggZEFL-mEAX2HyoHAEiA6LvprLQ\r\n\r\nYou\'re receiving this email because you signed up for a Zoom account.\r\nIf you wish to be removed from our email list, unsubscribe\r\nhttp://click.zoom.us/emailPreference/e/epc/84442/Z4sNg-ai_1Bd7QCSlAKTa8rAGIW9jDDfDOB8fd6lNg8/654/33092069f1bf9117c60164e0332503d63a464d0deab5e94d81c25a5211c6bc29/3502022752\r\n', 74, 'a:0:{}', 0, 0),
