(83, 0, '2021-08-25 19:20:04', 'Hi there,\r\n\r\nIt’s been an exciting month. \r\n\r\nWe are proud to announce that the Postman Public API Network is now the largest API hub in the world, serving 17 million users and 500,000 organizations worldwide. The global directory hosts thousands of public APIs, connecting international developers and providing a central catalog of APIs built for discovery, exploration, and sharing. If you haven’t had a chance to explore it, then we encourage you to take a look.\r\n\r\nAnother August item: Postman OpenAPI Specification Lead Mike Ralphson and his team recently analyzed a massive third-party archive of nearly 200,000 OpenAPI files. Learn what they discovered about the global API landscape in this detailed blog post.\r\n\r\nNow, let’s take a look at what else Postman is bringing you this month, shall we?\r\n\r\n\r\n\r\nUPCOMING EVENTS\r\n\r\n⦿ More “Breaking Changes” Episodes on the Way\r\n\r\nBreaking Changes is a weekly talk show where Postman Chief Evangelist Kin Lane hosts stellar guests from all across the API universe to discuss, debate, and solve the latest topics around APIs and API-first.\r\n\r\nYou can listen to every episode on these podcast platforms:\r\nSpotify [link: https://open.spotify.com/show/5ig80ZlBLiC2iXxql0s1q2]\r\nApple Podcasts [link: https://podcasts.apple.com/us/podcast/breaking-changes/id1574147652]\r\nGoogle Podcasts [link: https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkLnBvZGJlYW4uY29tL2JyZWFraW5nY2hhbmdlcy9mZWVkLnhtbA==]\r\nAmazon Music [link: https://music.amazon.com/podcasts/ea40d8b4-8cbb-4061-b618-794c3bbbbd42/Breaking-Changes]\r\n\r\nUp next on Breaking Changes, we’ll be streaming these episodes on Wednesdays at 9:00 a.m. (PDT): \r\nEpisode 13: “The API Economy in a Remote-First World” with Nylas Co-Founder and CEO Gleb Polyakov\r\nEpisode 14: “Managing Data Sprawl and Interoperability” with mParticle Director of Engineering Melissa Benua\r\nEpisode 15: “A Real-World Approach to API Infrastructure” with VMware Global Field CTO Dekel Tankel\r\nEpisode 16: \"The Real-World Business of Doing Global APIs\" with Euler Hermes Head of Doc, Identity, and Access Management Sophie Rutard\r\n\r\nGet the Breaking Changes tl;dr\r\nFresh blog posts recapping recent episodes with Kin’s stellar guests: \r\nEpisode 1 Recap: Shutterstock’s Alex Reynolds --&gt;> https://blog.postman.com/breaking-changes-episode-1-shutterstock-alex-reynolds/\r\nEpisode 2 Recap: LaunchAny’s James Higginbotham --&gt;> https://blog.postman.com/breaking-changes-episode-2-recap-launchany-james-higginbotham/\r\n\r\n\r\n--&gt;> Subscribe to the Show: https://www.postman.com/events/breaking-changes/\r\n\r\n\r\nThe Postman API Network\r\n\r\n⦿ APIs for Application Security\r\n\r\nLooking for new APIs? Check out these security-minded companies working hard to keep your applications safe and sound in Postman’s latest featured list: APIs for Application Security. Play with these APIs by forking their collections to your own workspace and exploring the possibilities.\r\n\r\n--&gt;> Read the blog post: https://blog.postman.com/apis-for-application-security/\r\n\r\n\r\nProduct Updates\r\n\r\n⦿ Govern Your Public API Collections More Effectively\r\n\r\nMaintain full oversight, even when your team is enterprise-sized. We\'ve just made it easier for enterprises to manage their growing teams\' public API collections—Postman Engineering Manager Avinash Choudhary explains the details in this blog post. \r\n\r\n--&gt;> Read the blog post: https://blog.postman.com/govern-your-public-api-collections-more-effectively/\r\n\r\n\r\n⦿ Postman Now Supports Socket.IO\r\n\r\nYou can now test your real-time Socket.IO APIs in Postman. This represents a big step for Postman in our goal to provide exceptional tooling and support for the WebSocket community. Postman Technical Lead Joshua Wise shares the key details in his new blog post. \r\n\r\n--&gt;> Read the blog post: https://blog.postman.com/postman-now-supports-socket-io/\r\n\r\n\r\n\r\nPostman Resources \r\n\r\n⦿ Testing Payments with Stripe’s New Postman Collections\r\n--&gt;> Read the blog post: https://blog.postman.com/testing-payments-with-stripes-new-postman-collection/\r\n\r\n⦿ Leverage Cloud Technologies with the Codebase Integrations Public Workspace\r\n--&gt;> Read the blog post: https://blog.postman.com/leverage-cloud-technologies-with-codebase-integrations-public-workspace/\r\n\r\n\r\n⦿ Get More Out of Postman by Collaborating with Your Team\r\n--&gt;> Read the blog post: https://blog.postman.com/get-more-out-of-postman-by-collaborating-with-your-team/\r\n\r\n\r\n\r\n\r\n-\r\n', 83, 'a:0:{}', 0, 0),
